package com.spotadev.algo.blind75.slidingwindow.hard.minimum_window_substring;

import org.testng.Assert;

/**
 * See MimimumWindowSubstring for the question.  
 * 
 * This was the fastest solution from leetcode.  The performance was 1 ms which was 32 times 
 * faster than my solution in MimimumWindowSubstring.
 * 
 * The main performance enhancement he has is not using a map.  As char can be cast to int,
 * wherever you want to use a Map where the key is a Character you can instead use an array
 * where the index of the array is the Character.  This can speed up performance 32 times
 * 
 * @author John Dickerson - 14 Jun 2022
 */
public abstract class AbstractMinimumWindowSubstringTest {

    protected MinimumWindowSubstringFastest_JD minimumWindowSubstring;

    void minWindowTest_1() {

        String minWindow = minimumWindowSubstring.minWindow( "ADOBECODEBANC", "ABC" );
        Assert.assertEquals( minWindow, "BANC" );
    }


    void minWindowTest_2() {

        String minWindow = minimumWindowSubstring.minWindow( "a", "a" );
        Assert.assertEquals( minWindow, "a" );
    }


    void minWindowTest_3() {

        String minWindow = minimumWindowSubstring.minWindow( "a", "aa" );
        Assert.assertEquals( minWindow, "" );
    }


    void minWindowTest_4() {

        String minWindow = minimumWindowSubstring.minWindow( "aa", "aa" );
        Assert.assertEquals( minWindow, "aa" );
    }


    void minWindowTest_5() {

        String minWindow = minimumWindowSubstring.minWindow( "acbbaca", "aba" );
        Assert.assertEquals( minWindow, "baca" );
    }


    void minWindowTest_6() {

        String minWindow = minimumWindowSubstring.minWindow( "abcdef", "cf" );
        Assert.assertEquals( minWindow, "cdef" );
    }


    void minWindowTest_7() {

        String minWindow = minimumWindowSubstring.minWindow( "abcdef", "ef" );
        Assert.assertEquals( minWindow, "ef" );
    }


    void minWindowTest_8() {

        String minWindow = minimumWindowSubstring.minWindow( "abecdeff", "ef" );
        Assert.assertEquals( minWindow, "ef" );
    }


    void minWindowTest_9() {

        String minWindow = minimumWindowSubstring.minWindow( "efbecdegff", "ef" );
        Assert.assertEquals( minWindow, "ef" );
    }


    void minWindowTest_10() {

        String minWindow = minimumWindowSubstring.minWindow(
                "abcdefghijkbacdefghjikmllmnopqrstuvwxyz",
                "abcdefghijklm" );
        Assert.assertEquals( minWindow, "bacdefghjikml" );
    }


    void minWindowTest_11() {

        String minWindow = minimumWindowSubstring.minWindow(
                ""
                        +
                        ""
                        +
                        "",

                "" );
        Assert.assertEquals( minWindow,
                "" );
    }
}
